import React from 'react';

function NavBar() {
  return (
    <div className="NavBar">
      <img src="images/Logo_LSC.png" alt="" />

      <div className="Menu">
        <Link to="/"> Home</Link>
        <Link to="/aboutMe">About Me</Link>
        <Link to="/project">Projects</Link>
      </div>

    </div>
  )
}

export default NavBar;
